import React from 'react';
import './index.css';
import Card from './Card';
import Footer from './Footer';
import Sdata from './Sdata';


function App() {
    return (
        <>
            <h1><b>Top 5 Netflix Series</b></h1>
            <div class="row">
                <div class="col-md-4">
                    <Card name={Sdata[0].namee}
                    imgsrc = {Sdata[0].imgsrc}
                    content = {Sdata[0].content}
                    link = {Sdata[0].link}
                    />
                </div>
            </div>
            
            <Footer/>
        </>
    );
}

export default App;
